var classe = require('./classe');

var Node = function(propriedades) {

  this.prox = null;
  this.ant = null;

  classe.getMetodos.call(this, propriedades);
  this.get = classe.get;

  this.eachProp = function(callback) {
    for(var prop in propriedades) {
      (function(i) {
        callback(i);
      })(prop);
    }
  };

};


module.exports = Node;
